import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <header className='header'>
                    <div className='logo'>
                        <div>
                            <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg'></img>
                        </div>
                        <div className=''>
                            <button>
                                <i class="fa fa-bars menu"></i>
                            </button>
                        </div>
                    </div>
                </header>
            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .header{
                    background: white;
                    display: flex;
                    flex-direction: row;
                    width: 100%;
                    height: 7%;
                }

                .header .logo{
                    width: 10%;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    text-align: right;
                }

                .header .logo img{
                    width: 50%;
                    height: 30%
                    margin-right: 10px;
                }

                .header .logo button{
                    color: gray;
                    font-size: 1.3rem;
                    background: transparent;
                    border: none;
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
